import React from 'react';
import {CardDisplayV} from './src/CardWidget';

const ServicesData=[ {name:"Access to basic tutorials"},
{name:"Basic resources"},
,
"Basic community access",
"eBooks",
"Podcats",
"Access to souces files",
"Live chat",];


const cardData=[
{
  planName:"free",
  amount:"$28 /month"
},
{
  planName:"Standard",
  amount:"$35 /month"
},
{
  planName:"Premium",
  amount:"$42 /month"
}
];

const background={
  bg1:{ backgroundColor:'black'},
  bg2:{ backgroundColor:'black'},
  bg3:{ backgroundColor:'black'}
}


const ContentHeaderStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles={
  display:'flex',
  fontWeight:'800',
  color:'black',
  textTransform: 'uppercase',
  fontSize:'20px',
  marginTop:'10px',
}

const ContentIconStyles={
  width:'100px',
  height:'100px'
}

const ContentDescriptionStyles={
  display:'flex',
  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}


function App() {
  return (
    <div>
     <CardDisplayV
     cardData={cardData}
     ServicesData={ServicesData}
     ContentHeaderStyles={ContentHeaderStyles}
     ContentTitleStyles={ContentTitleStyles}
     ContentIconStyles={ContentIconStyles}
     ContentDescriptionStyles={ContentDescriptionStyles}
     />
    </div>
  );
}

export default App;
